class CreatePatient extends Component {
  constructor(props) {
    super();
    this.state = {

    }

  }

  getSickCode = (id, name) => {
    console.log(id);
    this.props.getSickbypatient(id);
    this.props.setSickShowByPatient({ id, name });

  }

  render() {
    return (
      <div className=" contentlayout content-wrapper " >

      <h2>Initialize patients</h2>
      <div className="col-md-4">
      <div className="form-group ">
        <label htmlFor="example1">First and last name</label>
        <input type="text" id="example1" className="form-control form-control-lg" />
      </div>
      <div className="form-group">
        <label htmlFor="example2">Citizen identification number</label>
        <input type="text" id="example2" className="form-control form-control-md" />
      </div>
      <div className="form-group">
        <label htmlFor="example3">Age</label>
        <input type="number" id="example3" className="form-control form-control-sm" min = "1" max = "100"/>
      </div>
      <div className="form-group">
        <label>Gender</label>
        <input type="" id="example3" className="form-control form-control-sm" min = "1" max = "100"/>
      </div>
      </div>
      </div>
    )
  }
}

export default CreatePatient;
